DROP TABLE IF EXISTS `REC_PROCEEDS`;
CREATE TABLE `REC_PROCEEDS` (
  `INTER_ID` int(11) NOT NULL AUTO_INCREMENT,
  `AMOUNT` double DEFAULT NULL,
  `BANK` varchar(255) DEFAULT NULL,
  `BANK_COST` double DEFAULT NULL,
  `BANK_NUM` varchar(50) DEFAULT NULL,
  `BILL_NO` varchar(20) DEFAULT NULL,
  `CANCELLATION` int(11) DEFAULT '0',
  `cashSubject` varchar(255) DEFAULT NULL,
  `CHECK_DATE` datetime DEFAULT NULL,
  `CHECKER` int(11) DEFAULT NULL,
  `CHILDREN` int(11) DEFAULT '0',
  `CREATED` datetime DEFAULT NULL,
  `CREATER` int(11) DEFAULT NULL,
  `CURRENCY_ID` int(11) DEFAULT NULL,
  `CUST_BANK` varchar(255) DEFAULT NULL,
  `CUST_BANK_NUM` varchar(50) DEFAULT NULL,
  `CUSTOMER_ID` int(11) DEFAULT NULL,
  `DATE` datetime DEFAULT NULL,
  `DEPARTMENT_ID` int(11) DEFAULT NULL,
  `EMPLOYEE_ID` int(11) DEFAULT NULL,
  `EXCHANGE_RATE` double DEFAULT NULL,
  `EXPLANATION` varchar(200) DEFAULT NULL,
  `FREIGHT_AMOUNT` double DEFAULT NULL,
  `LASTMOD` datetime DEFAULT NULL,
  `MODIFIER` int(11) DEFAULT NULL,
  `PROC_INST_ID` varchar(64) DEFAULT NULL,
  `REC_TYPE` varchar(20) DEFAULT NULL,
  `REMARK` varchar(2000) DEFAULT NULL,
  `RESULT` int(11) DEFAULT '0',
  `SETTLE_AMOUNT` double DEFAULT NULL,
  `SETTLE_CURRENCY` int(11) DEFAULT NULL,
  `SETTLE_DATE` datetime DEFAULT NULL,
  `SETTLE_ID` int(11) DEFAULT NULL,
  `SETTLE_NUM` varchar(20) DEFAULT NULL,
  `SOURCE_BILL_NO` varchar(20) DEFAULT NULL,
  `SOURCE_TYPE` varchar(20) DEFAULT NULL,
  `STATUS` varchar(1) DEFAULT NULL,
  `SUBJECT` varchar(20) DEFAULT NULL,
  `TOTAL_AMOUNT` double DEFAULT NULL,
  PRIMARY KEY (`INTER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

