  `QUANTITY` int(11) DEFAULT NULL,
  `REMARK` varchar(2000) DEFAULT NULL,
  `SETTLE_AMOUNT` double DEFAULT NULL,
  `SETTLE_QTY` int(11) DEFAULT NULL,
  `SOURCE_BILL_NO` varchar(20) DEFAULT NULL,
  `STATUS` varchar(1) DEFAULT NULL,
  `MASTER` int(11) DEFAULT NULL,
  PRIMARY KEY (`ENTRY_ID`),
  KEY `FK_mn2d4to4gnik57o5cywb3quu5` (`MASTER`),
  CONSTRAINT `FK_mn2d4to4gnik57o5cywb3quu5` FOREIGN KEY (`MASTER`) REFERENCES `REC_PROCEEDS` (`INTER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

